script: |
  super -f text -I q5065.spq | sort > q5065.out

inputs:
  - name: q5065.spq
    data: |
      SELECT DISTINCT CAST ( NULL AS INTEGER ), - col0 * + ( + 88 ) * + col1 + + col0 + + CAST ( + col0 AS INTEGER ) * + col2 FROM tab1 (FORMAT parquet) WHERE 71 NOT BETWEEN - col2 * - col1 / - col2 AND NULL;
  - name: tab1

outputs:
  - name: q5065.out
    data: |
